import { Fragment, useCallback, useEffect, useMemo, useState } from "react";
import { InputSelect } from "./components/InputSelect";
import { Instructions } from "./components/Instructions";
import { Transactions } from "./components/Transactions";
import { useEmployees } from "./hooks/useEmployees";
import { usePaginatedTransactions } from "./hooks/usePaginatedTransactions";
import { useTransactionsByEmployee } from "./hooks/useTransactionsByEmployee";
import { EMPTY_EMPLOYEE } from "./utils/constants";
import { Employee } from "./utils/types";

export function App() {
  const { data: employees, ...employeeUtils } = useEmployees();
  const { data: paginatedTransactions, ...paginatedTransactionsUtils } = usePaginatedTransactions();
  const { data: transactionsByEmployee, ...transactionsByEmployeeUtils } = useTransactionsByEmployee();

  const [isLoading, setIsLoading] = useState(false);
  const [isAllEmployees, setIsAllEmployees] = useState(true);
  const [transactionsInitialized, setTransactionsInitialized] = useState(false);

  // Use a single state for active transactions
  const [activeTransactions, setActiveTransactions] = useState<any[]>([]);

  const transactions = useMemo(() => {
    return isAllEmployees ? paginatedTransactions?.data || [] : transactionsByEmployee || [];
  }, [isAllEmployees, paginatedTransactions, transactionsByEmployee]);

  // Load all transactions for all employees
  const loadAllTransactions = useCallback(async () => {
    setIsLoading(true);
    transactionsByEmployeeUtils.invalidateData(); // Clear previous employee data

    await employeeUtils.fetchAll(); // Fetch employees
    await paginatedTransactionsUtils.fetchAll(); // Fetch paginated transactions

    setIsLoading(false);
  }, [employeeUtils, paginatedTransactionsUtils, transactionsByEmployeeUtils]);

  // Load transactions for a specific employee
  const loadTransactionsByEmployee = useCallback(async (employeeId: string) => {
    paginatedTransactionsUtils.invalidateData(); // Clear previous paginated transactions
    await transactionsByEmployeeUtils.fetchById(employeeId); // Fetch transactions for the selected employee
  }, [paginatedTransactionsUtils, transactionsByEmployeeUtils]);

  // Initialize transactions on the first load
  useEffect(() => {
    const initialize = async () => {
      if (!employees && !employeeUtils.loading) {
        await loadAllTransactions(); // Fetch employees and transactions if not loaded
      }

      // Set transactions only if they haven't been initialized
      if (employees && !transactionsInitialized) {
        setTransactionsInitialized(true);
        setActiveTransactions(paginatedTransactions?.data || []);
      }
    };

    initialize();
  }, [employees, employeeUtils.loading, loadAllTransactions, transactionsInitialized, paginatedTransactions?.data]);

  // Handle employee selection changes
  const handleEmployeeChange = useCallback(
    async (newEmployee: Employee | null) => {
      setIsLoading(true) // Start loading indicator

      // Check if no employee is selected or "All Employees" is selected
      if (!newEmployee || newEmployee.id === "all-employees") {
        console.log("Switching to All Employees.")
        setIsAllEmployees(true)
        invalidateData() // Clear any previous employee-specific transactions

        // Fetch paginated transactions for all employees
        await fetchPaginatedTransactions() // This should also update the active transactions state

        // Ensure activeTransactions is updated from paginatedTransactions
        setActiveTransactions(paginatedTransactions?.data || [])
      } else {
        console.log(`Fetching transactions for employee ID: ${newEmployee.id}`)
        setIsAllEmployees(false)

        // Fetch transactions for the selected employee
        await loadTransactionsByEmployee(newEmployee.id)

        // After fetching, update the active transactions based on the employee's transactions
        if (transactionsByEmployee) {
          setActiveTransactions(transactionsByEmployee || [])
        } else {
          console.warn("No transactions found for the selected employee.")
        }
      }

      setIsLoading(false) // Stop loading indicator
    },
    [fetchPaginatedTransactions, invalidateData, loadTransactionsByEmployee, transactionsByEmployee]
  )


  return (
    <Fragment>
      <main className="MainContainer">
        <Instructions />
        <hr className="RampBreak--l" />

        <InputSelect<Employee>
          isLoading={isLoading}
          defaultValue={EMPTY_EMPLOYEE}
          items={employees ? [EMPTY_EMPLOYEE, ...employees] : []}
          label="Filter by employee"
          loadingLabel="Loading employees..."
          parseItem={(item) => ({
            value: item.id,
            label: `${item.firstName} ${item.lastName}`,
          })}
          onChange={handleEmployeeChange} // Handle employee selection
        />

        <div className="RampBreak--l" />

        <div className="RampGrid">
          {isLoading ? (
            <div>Loading transactions...</div>
          ) : (
            <Transactions transactions={transactions} /> // Display transactions
          )}

          {isAllEmployees && paginatedTransactions?.nextPage && ( // Only show "View More" for all employees
            <button
              className="RampButton"
              onClick={async () => {
                await paginatedTransactionsUtils.fetchAll(); // Load more transactions
              }}
              disabled={isLoading || paginatedTransactionsUtils.loading}
            >
              View More
            </button>
          )}
        </div>
      </main>
    </Fragment>
  );
}
